  false,\n\t\"url\": null,\n\t\"notes\": \"The Newport Hydrographic (NH) Line along
  44.65u00b0N off central Oregon was sampled seasonally during two epochs: 1961-1971
  through the TENOC program and 1997-2003 through the GLOBEC Northeast Pacific Long
  Term Observations Program (LTOP); some observations are available for 2004 and 2005.
  During TENOC, the line extended 305 km offshore to 128u00b0W, with stations 18 km
  apart over the continental shelf and 36 km offshore. During LTOP, the line was shorter
  (to 126u00b0W) with closer station spacing over the continental shelf (9 km apart)
  and slope (18 km apart). LTOP cruises included biochemical sampling and underway
  current measurements.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
